function Navbar() {
  return (
    <nav className="navbar">
    <div className="navbar">
      <div className="menu">
        <div className="menu-item">QUIEN SOY</div>
        <div className="menu-item">RESULTADOS</div>
        <div className="menu-item">FAQ</div>
      </div>
      <div className="title">Diabetes <span className="recovery">Recovery</span></div>
      <div className="icon">
        <i className="phone-icon"></i>
      </div>
    </div>
    </nav>
  );
}
export default Navbar;
